import React from 'react';
import './GameField.css'
import Card from './Card';

function GameField() {
    return (
        <div className="game-field">
            <button className="btn btn-default">aaaaaaaaa</button>
            <div>This is where we play...</div>            
            <div className="cardlist">
                <Card number={1}/>
                <Card number={2}/>
                <Card number={3}/>
                <Card number={2}/>
            </div>
        </div>
        );
}

export default GameField;
